INSERT INTO `dictionary` VALUES (2393, 27, 1, 1197, '&lt;p&gt;Les patients peuvent d&eacute;montrer des probl&egrave;mes de peau pendant et apr&egrave;s le traitement de radioth&eacute;rapie. R&eacute;pondez vous-m&ecirc;me &agrave; toutes les questions en choissisant le chiffre qui correspond le mieux &agrave; votre situation au cours de la derni&egrave;re journ&eacute;e.&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 14:23:51', 'QUESTIONNAIRE_MIGRATION_2019');
