INSERT INTO `dictionary` VALUES (2411, 27, 1, 1206, '&lt;p&gt;&lt;span style="font-size: 14px;float: none;"&gt;Les patients signalent parfois qu\'ils pr&eacute;sentent les sympt&ocirc;mes suivants. Veuillez indiquer la s&eacute;v&eacute;rit&eacute; des sympt&ocirc;mes que vous avez ressentis lors de la derni&egrave;re semaine.&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 14:23:51', 'QUESTIONNAIRE_MIGRATION_2019');
