INSERT INTO `dictionary` VALUES (2419, 27, 1, 1210, '&lt;p&gt;&Eacute;tude sur les mat&eacute;riels &eacute;ducatifs: Invitation &agrave; participer &agrave; une &eacute;tude&lt;/p&gt;&lt;p&gt;Cher Utilisateur d’Opal,&lt;/p&gt; &lt;p&gt;Ce message est pour vous informer d’une &eacute;tude qui prendra place au Centre du cancer des C&egrave;dres. Le projet de recherche est men&eacute; par une infirmi&egrave;re et l’objectif est d’explorer vos pens&eacute;es par rapport aux mat&eacute;riels &eacute;ducatifs qui vous sont fourni dans l’application Opal.&lt;/p&gt;&lt;p&gt;Si vous aimeriez en savoir d’avantage, veuillez lire l’information ci-dessous.&lt;/p&gt;&lt;p&gt;Merci,&lt;/p&gt;&lt;p&gt;L’&eacute;quipe de d&eacute;veloppement Opal&lt;/p&gt;&lt;p&gt;****************************************&lt;/p&gt;&lt;p&gt;Bonjour, je m’appelle Katherine Mohsen, je suis infirmi&egrave;re et je m&egrave;ne un projet de recherche dans le cadre de ma maitrise. Mon objectif est de mieux comprendre comment les patients, tel que vous-m&ecirc;mes, acc&eacute;dez et utilisez les mat&eacute;riels &eacute;ducatifs qui vous sont fourni dans Opal. Nous esp&eacute;rons que cette &eacute;tude nous donnera une id&eacute;e de votre exp&eacute;rience avec Opal.&lt;/p&gt;&lt;p&gt;Si vous acceptez de participer, votre participation comprendra une entrevue d’une dur&eacute;e de 30 &agrave; 60 minutes en personne &agrave; l’h&ocirc;pital ou au t&eacute;l&eacute;phone &agrave; une heure qui vous convient. L’entrevue sera enregistr&eacute;e. Toutes informations que vous contribuez sera conserv&eacute;es d’une mani&egrave;re confidentielle. &Agrave; tous moments, vous aurez le droit de refuser de r&eacute;pondre &agrave; n’importe quelle question, d’arr&ecirc;ter l’entrevue ou de vous retirer de cette &eacute;tude.&lt;/p&gt;&lt;p&gt;Une fois l’entrevue termin&eacute;e, vous recevrez une carte cadeau d’une valeur de 10$. Si vous stationnez dans le stationnement de l’h&ocirc;pital, sur pr&eacute;sentation du re&ccedil;u, vous recevrez un coupon qui vous permettra de quitter le stationnement sans frais.&lt;/p&gt;&lt;p&gt;Les entrevues prendront place de septembre &agrave; novembre 2019.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 14:23:51', 'QUESTIONNAIRE_MIGRATION_2019');
INSERT INTO `dictionary` VALUES (2420, 27, 2, 1210, '&lt;p&gt;Educational Material Research Study: An invitation to participate in research about Opal&lt;/p&gt;&lt;p&gt;Dear Opal User,&lt;/p&gt;&lt;p&gt;This message is to inform you of a new research study taking place at the Cedars Cancer Centre. The research study is being conducted by a nurse and the study\'s aim is to understand what your thoughts are about the education material provided to you in the Opal application.&lt;/p&gt;&lt;p&gt;If you would like to find out more, please read below.&lt;/p&gt;&lt;p&gt;Thank you,&lt;/p&gt;&lt;p&gt;The Opal Development Team&lt;/p&gt;&lt;p&gt;****************************************&lt;/p&gt;&lt;p&gt;Hello, my name is Katherine Mohsen, I am a nurse who is conducting a study as part of a master’s degree. My goal is to better understand how patients, such as yourself, access and use the educational material provided in Opal. We hope the study will give us some idea of your experience with Opal.&lt;/p&gt;&lt;p&gt;If you agree, your participation will involve a 30 to 60 minute interview in person at the hospital or over the phone at a time that is convenient for you. The interview will be audio recorded. Any information you provide will be kept confidential. You will have the right to refuse to answer any question during the interview. You will also have the right to stop participating in the study at any point.&lt;/p&gt;&lt;p&gt;Upon completion of the interview, you will receive a 10$ gift card. If you park in the hospital parking, we will arrange for a parking voucher for you to be able to exit upon presentation of the receipt.&lt;/p&gt;&lt;p&gt;The interviews will take place from September to November 2019.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 14:23:51', 'QUESTIONNAIRE_MIGRATION_2019');
INSERT INTO `dictionary` VALUES (2421, 27, 1, 1211, '&lt;p&gt;&Eacute;tude sur les mat&eacute;riels &eacute;ducatifs: Information pour participer &agrave; l’&eacute;tude&lt;/p&gt;&lt;p&gt;Bonjour Utilisateur d’Opal,&lt;/p&gt;&lt;p&gt;Merci d’avoir r&eacute;pondu au questionnaire pr&eacute;c&eacute;dent et merci de votre int&eacute;r&ecirc;t dans l’&eacute;tude. Avant que Katherine vous contacte, nous aimerions aussi que vous r&eacute;pondiez aux questions suivantes afin qu’elle confirme si vous &ecirc;tes &eacute;ligible &agrave; participer &agrave; l’&eacute;tude. Vos r&eacute;ponses aux questions ci-dessous seront transmise &agrave; Katherine de mani&egrave;re confidentielle.&lt;/p&gt;&lt;p&gt;Merci,&lt;br/&gt;L’&Eacute;quipe de d&eacute;veloppement Opal&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 14:23:51', 'QUESTIONNAIRE_MIGRATION_2019');
INSERT INTO `dictionary` VALUES (2422, 27, 2, 1211, '&lt;p&gt;Educational Material Research Study: Participation Information&lt;/p&gt;&lt;p&gt;Hello Opal User,&lt;/p&gt;&lt;p&gt;Thank you for answering the previous questionnaire and showing interest in the study about Opal. Before Katherine contacts you, we would like you to answer the following questions to help Katherine determine your eligibility to participate in the study. The information you provide here will be transmitted to Katherine in a confidential manner.&lt;/p&gt;&lt;p&gt;Thank you,&lt;br/&gt;The Opal Development Team&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 14:23:51', 'QUESTIONNAIRE_MIGRATION_2019');
