INSERT INTO `dictionary` VALUES (2929, 27, 1, 1465, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;THIS IS A DRAFT QUESTIONNAIRE DO NOT PUBLISH WITHOUT FULL APPROVAL &lt;/span&gt;&lt;/p&gt;&lt;!--StartFragment--&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Les patients signalent parfois qu\'ils présentent les symptômes suivants lorsqu\'ils reçoivent une radiothérapie pour un &lt;b&gt;cancer situé dans le bassin&lt;/b&gt; (par ex. prostate, vessie, colorectal). Veuillez indiquer la sévérité des symptômes que vous avez ressentis lors de la dernière semaine.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;Les réponses que vous apportez fourniront à votre médecin un aperçu de votre santé et vous feront gagner du temps lors de votre rendez-vous. Si vous avez des questions ou si vous avez des doutes, veuillez en informer votre médecin.&lt;/p&gt;&lt;!--EndFragment--&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-02-25 08:53:53', 'hpatrick', '2020-02-25 14:10:16', 'hpatrick');
