INSERT INTO `dictionary` VALUES (4209, 27, 1, 2105, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Votre chirurgien orthopédique oncologue (Dr. Turcotte) aimerait que vous remplissez ce questionnaire. Vos réponses seront examinées par votre chirurgien orthopédique oncologue et ajoutées à votre dossier. &lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Les questions suivantes ont pour but de vérifier votre capacité d’accomplir des activités courantes. Compte tenu de degré de difficulté que vous éprouvez en raison de l’état de votre jambe, veuillez répondre aux questions en choisissant la description qui correspond le mieux à votre capacité de réaliser cette activité &lt;/span&gt;&lt;b style=&quot;font-size: 14px;&quot;&gt;&lt;u&gt;durant la dernière semaine&lt;/u&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;.&lt;/span&gt;&lt;!--EndFragment--&gt;&lt;br/&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-03-02 16:10:23', 'MACFARIA', '2020-03-02 21:10:23', 'MACFARIA');
INSERT INTO `dictionary` VALUES (4210, 27, 2, 2105, '&lt;div style=&quot;font-size: 14px;&quot;&gt;&lt;p&gt;Your Orthopaedic Oncologist (Dr. Turcotte) has requested that you please complete this questionnaire. The answers you provide will be viewed by your Orthopaedic Oncologist and will be added to your file. &lt;/p&gt;&lt;/div&gt;&lt;div style=&quot;font-size: 14px;&quot;&gt;&lt;br/&gt;The following questions ask about your ability to perform activities that are common to every day life. Considering the amount of difficulty you have performing the activity due to the current problem you are having with your leg, please answer the questions by choosing the answer that best describes your ability to do the activity &lt;b&gt;&lt;u&gt;over the past week.&lt;/u&gt;&lt;/b&gt;&lt;/div&gt;&lt;!--EndFragment--&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-03-02 16:10:23', 'MACFARIA', '2020-03-02 21:10:23', 'MACFARIA');
