INSERT INTO `dictionary` VALUES (9129, 27, 1, 4562, '&lt;p&gt;Vous avez reçu un diagnostic positif pour la COVID-19. Vous êtes invité à remplir ce questionnaire chaque semaine pendant 14 jours. En complétant ce questionnaire chaque semaine, vous fournirez des informations importantes sur vos symptômes et vos signes vitaux. Ces informations seront revues par une infirmière à toutes les semaines pour évaluer vos besoins en termes de soins. Ce questionnaire fournira aussi des conseils importants. &lt;br/&gt; &lt;br/&gt;Si vous n’êtes pas en mesure de remplir ce questionnaire par vous-même, il peut être complété par quelqu’un d’autre.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 1, 'briana', '2020-07-19 15:37:37', 'MACFARIA', '2020-07-21 16:38:47', 'briana');
INSERT INTO `dictionary` VALUES (9130, 27, 2, 4562, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;You have been diagnosed with COVID-19. You are invited to complete this questionnaire each week for 14 days. By completing this questionnaire weekly, you provide important information on your symptoms and vital signs. This information is looked at by a nurse every week to evaluate your care needs. The questionnaire will also provide you with important advice. &lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt; &lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;If you are unable to complete the questionnaire yourself, someone else may complete it for you. &lt;/span&gt;&lt;!--EndFragment--&gt;&lt;br/&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 1, 'briana', '2020-07-19 15:37:37', 'MACFARIA', '2020-07-21 16:38:47', 'briana');
