INSERT INTO `dictionary` VALUES (9687, 23, 1, 4841, 'Si vous avez coché au moins un des problèmes évoqués, à quel point ce(s) problème(s) a-t-il (ont-ils) rendu votre travail, vos tâches à la maison ou votre capacité à vous entendre avec les autres difficile(s) ?', 0, '', '2020-07-24 10:40:19', 'MACFARIA', '2020-07-27 17:10:42', 'romina');
