INSERT INTO `dictionary` VALUES (9701, 27, 1, 4848, 'Questionnaire sur la santé du patient-9 (PHQ-9)', 0, '', '2020-07-24 10:50:55', 'MACFARIA', '2020-08-07 15:12:10', 'briana');
INSERT INTO `dictionary` VALUES (9702, 27, 2, 4848, 'Patient Health Questionnaire-9 (PHQ-9)', 0, '', '2020-07-24 10:50:55', 'MACFARIA', '2020-08-07 15:12:10', 'briana');
INSERT INTO `dictionary` VALUES (9703, 27, 1, 4849, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;&lt;/span&gt;Le PHQ-9 (Questionnaire sur la santé du patient-9) est un outil de dépistage utilisé pour mesurer la sévérité de symptômes dépressifs chez les patient(e)s. &lt;br/&gt;&lt;br/&gt;Votre équipe de soins aimerait que vous remplissiez ce questionnaire. Vos réponses seront révisées par votre équipe et utilisées pour orienter votre rendez-vous. &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;!--StartFragment--&gt;&lt;b style=&quot;font-size: 14px;&quot;&gt;Veuillez indiquer à quelle fréquence &lt;/b&gt;vous avez été gêné(e) par les problèmes suivants au cours des deux dernières semaines.&lt;/b&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-07-24 10:50:55', 'MACFARIA', '2020-08-07 15:12:10', 'briana');
INSERT INTO `dictionary` VALUES (9704, 27, 2, 4849, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;&lt;/span&gt;The PHQ-9 (Patient Health Questionnaire-9) is a screening tool used to measure the severity of depression symptoms in patients. &lt;br/&gt;&lt;br/&gt;Your healthcare team has requested that you please complete this questionnaire. The answers you provide will be viewed by your team and used to help focus your appointment. &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Please indicate how often you have been bothered by any of the following problems o&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;ver the last 2 weeks.&lt;/span&gt;&lt;/b&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-07-24 10:50:55', 'MACFARIA', '2020-08-07 15:12:10', 'briana');
