INSERT INTO `dictionary` VALUES (9815, 27, 1, 4905, '&lt;p&gt;L’échelle GAD-7 (Generalized Anxiety Disorder-7) est un outil de dépistage utilisé pour mesurer la sévérité de symptômes anxieux chez les patient(e)s. &lt;br/&gt;&lt;br/&gt;Votre équipe de soins aimerait que vous remplissiez ce questionnaire. Vos réponses seront révisées par votre équipe et utilisées pour orienter votre rendez-vous. &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Veuillez indiquer à quelle fréquence vous avez été dérangé par les problèmes suivants au cours des deux dernières semaines.&lt;/b&gt;&lt;/p&gt;', 0, '', '2020-07-24 11:41:00', 'MACFARIA', '2020-08-07 15:09:42', 'briana');
INSERT INTO `dictionary` VALUES (9816, 27, 2, 4905, '&lt;p&gt;The GAD-7 (Generalized Anxiety Disorder-7) is a screening tool used to measure the severity of anxiety symptoms in patients. &lt;br/&gt;&lt;br/&gt;Your healthcare team has requested that you please complete this questionnaire. The answers you provide will be viewed by your team and used to help focus your appointment. &lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Please indicate how often you have been bothered by the following problems o&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;ver the last 2 weeks.&lt;/span&gt;&lt;/b&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-07-24 11:41:00', 'MACFARIA', '2020-08-07 15:09:42', 'briana');
