INSERT INTO `dictionary` VALUES (10831, 27, 1, 5413, '&lt;p&gt;Le PHQ-9 (Questionnaire sur la santé du patient-9) est un outil de dépistage utilisé pour mesurer la sévérité de symptômes dépressifs chez les patient(e)s. &lt;br/&gt;&lt;br/&gt;Votre équipe de soins aimerait que vous remplissiez ce questionnaire. Vos réponses seront révisées par votre équipe et utilisées pour orienter votre rendez-vous. &lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-10 09:20:25', 'briana', '2020-08-10 13:20:25', 'briana');
INSERT INTO `dictionary` VALUES (10832, 27, 2, 5413, '&lt;p&gt;The PHQ-9 (Patient Health Questionnaire-9) is a screening tool used to measure the severity of depression symptoms in patients. &lt;br/&gt;&lt;br/&gt;Your healthcare team has requested that you please complete this questionnaire. The answers you provide will be viewed by your team and used to help focus your appointment. &lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-10 09:20:25', 'briana', '2020-08-10 13:20:25', 'briana');
