INSERT INTO `dictionary` VALUES (12152, 23, 2, 6073, 'Your thoughts and feelings ----- This includes emotions (feeling sad, anxious, etc.), motivation to take medication, medication-related knowledge and beliefs as well as acceptance of having HIV.', 0, '', '2020-08-26 17:08:06', 'yuanchao', '2020-08-27 02:40:53', 'yuanchao');
