INSERT INTO `dictionary` VALUES (12281, 27, 1, 6138, '&lt;p&gt;Les patient(e)s rapporteront fréquemment qu\'après certaines chirurgies, ils/elles ressentent de la douleur. Votre chirurgien(ne) plasticien(ne) aimerait surveiller l\'étendue de votre douleur et la quantité d\'analgésique dont vous avez besoin pour suivre vos progrès. Vos réponses seront examinées avec vous lors de votre rendez-vous de suivi.&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-27 13:32:03', 'briana', '2020-08-27 17:32:03', 'briana');
INSERT INTO `dictionary` VALUES (12282, 27, 2, 6138, '&lt;p&gt;Patients will frequently report that after certain surgeries that they have pain. Your plastic surgeon would like to monitor the extent of your pain and how much pain medication you need to help monitor your progress. Your responses will be reviewed with you at your follow-up appointment.&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-27 13:32:03', 'briana', '2020-08-27 17:32:03', 'briana');
