INSERT INTO `dictionary` VALUES (12481, 27, 1, 6238, '&lt;p&gt;&lt;i&gt;Les domaines suivants peuvent rendre difficile de prendre vos médicaments pour le VIH, tels que prescrits.&lt;br/&gt;&lt;br/&gt;&lt;u&gt;&lt;b&gt;Au cours des 4 dernières semaines&lt;/b&gt;&lt;/u&gt;, à quelle fréquence ces domaines ont-ils rendu difficile la prise de vos médicaments pour le VIH ? Par difficile, nous entendons que la prise de vos médicaments a été soit sautée, retardée ou très déplaisante. &lt;br/&gt;&lt;br/&gt;Indiquez votre réponse sur la ligne.&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', 1, 'yuanchao', '2020-09-08 10:44:21', 'yuanchao', '2020-09-30 20:32:37', 'yuanchao');
INSERT INTO `dictionary` VALUES (12482, 27, 2, 6238, '&lt;p&gt;&lt;i&gt;The following areas of life can make it difficult to take your HIV medication, as prescribed. &lt;br/&gt;&lt;br/&gt;&lt;u&gt;&lt;b&gt;In the past 4 weeks&lt;/b&gt;&lt;/u&gt;, how often did these areas make it difficult to take your HIV medication? By difficult, we mean that taking your medication was either skipped, delayed or very unpleasant. &lt;br/&gt;&lt;br/&gt;Mark your response on the line. &lt;/i&gt;&lt;br/&gt;&lt;/p&gt;', 1, 'yuanchao', '2020-09-08 10:44:21', 'yuanchao', '2020-09-30 20:32:37', 'yuanchao');
