INSERT INTO `dictionary` VALUES (13259, 27, 1, 6627, '&lt;p style=&quot;font-size: 14px;&quot;&gt;Compte tenu de la pandémie actuelle de COVID-9, il est très important pour l\'équipe de soins de santé d\'évaluer le risque potentiel de chaque patient associé à une infection ou à une exposition à la COVID-19.&lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;&lt;/p&gt;&lt;p&gt;Vous devez remplir ce questionnaire pour être autorisé à vous présenter à votre rendez-vous.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;&lt;/p&gt;&lt;!--EndFragment--&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-09-29 14:28:51', 'MACFARIA', '2020-09-30 18:28:17', 'yuanchao');
INSERT INTO `dictionary` VALUES (13260, 27, 2, 6627, '&lt;p style=&quot;font-size: 14px;&quot;&gt;Considering the current COVID-19 pandemic, it is very important for the health care team to assess each patient\'s potential risk associated with infection or exposure to COVID-19.&lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;You must fill out this questionnaire to be allowed to present yourself at your appointment.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-09-29 14:28:51', 'MACFARIA', '2020-09-30 18:28:17', 'yuanchao');
