INSERT INTO `dictionary` VALUES (13429, 23, 1, 6712, 'Acceptez-vous que les informations que vous fournirez lors de l\'utilisation de cette application puissent être utilisées à des fins de recherche?', 0, '', '2020-10-06 16:44:25', 'MACFARIA', '2020-10-06 20:44:25', 'MACFARIA');
