INSERT INTO `dictionary` VALUES (14283, 27, 1, 7139, '&lt;p&gt;- Veuillez lire attentivement chaque question et choisir la réponse qui décrit le mieux votre réponse&lt;br/&gt;- Veuillez répondre à chaque question aussi honnêtement que possible&lt;br/&gt;- Si vous n\'êtes pas tout à fait sûr de la réponse la plus précise, sélectionnez la réponse qui vous semble la plus appropriée&lt;br/&gt;- Veuillez sélectionner &amp;#34;aucune difficulté&amp;#34; si une question ne s\'applique pas à vous&lt;br/&gt;- Ne passez pas trop de temps sur chaque énoncé.&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-10-16 20:01:53', 'MACFARIA', '2020-10-20 19:00:23', 'MACFARIA');
INSERT INTO `dictionary` VALUES (14284, 27, 2, 7139, '&lt;p&gt;- Please read each question carefully and select the response that best describes your answer&lt;br/&gt;- Please answer each question as honestly as possible&lt;br/&gt;- If you are not completely sure which response is the most accurate, select the response that you feel is the most appropriate&lt;br/&gt;- Please select ‘no difficulty’ if a question does not apply to you&lt;br/&gt;- Do not spend long on each statement.&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-10-16 20:01:53', 'MACFARIA', '2020-10-20 19:00:23', 'MACFARIA');
