INSERT INTO `dictionary` VALUES (20274, 27, 1, 9516, 'Version abrégée - ANGS', 0, NULL, '2021-03-23 17:03:29', 'MAYU6004', '2021-03-23 21:03:29', 'MAYU6004');
INSERT INTO `dictionary` VALUES (20275, 27, 2, 9516, 'Abridged - PG-SGA', 0, NULL, '2021-03-23 17:03:29', 'MAYU6004', '2021-03-23 21:03:29', 'MAYU6004');
INSERT INTO `dictionary` VALUES (20277, 27, 1, 9517, '&lt;p&gt;L\'Autoévaluation nutritionnelle globale subjective (ANGS) établit la norme et constitue l\'évaluation interdisciplinaire prééminente du patient (poids, consommation, symptômes, état fonctionnel, état de la maladie, stress métabolique et examen physique nutritionnel) en oncologie et dans d\'autres conditions cataboliques chroniques.&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-03-23 17:03:29', 'MAYU6004', '2021-03-23 21:03:29', 'MAYU6004');
INSERT INTO `dictionary` VALUES (20278, 27, 2, 9517, '&lt;p&gt;The Scored Patient-Generated Subjective Global Assessment (PG-SGA) sets the standard of and is the preeminent interdisciplinary patient assessment (weight, intake, symptoms, functional status, disease state, metabolic stress and nutritional physical examination) in oncology and other chronic catabolic conditions.&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-03-23 17:03:29', 'MAYU6004', '2021-03-23 21:03:29', 'MAYU6004');
