INSERT INTO `dictionary` VALUES (20442, 27, 1, 9572, 'PSO20210329 - Outil de dépistage de la détresse', 0, NULL, '2021-03-29 17:08:08', 'MAYU6004', '2021-03-29 21:14:00', 'MAYU6004');
INSERT INTO `dictionary` VALUES (20443, 27, 2, 9572, 'PSO20210329 - Distress screening tool', 0, NULL, '2021-03-29 17:08:08', 'MAYU6004', '2021-03-29 21:14:00', 'MAYU6004');
INSERT INTO `dictionary` VALUES (20445, 27, 1, 9573, '&lt;p&gt;La détresse est un sentiment d\'inconfort ou un bouleversement qui peut affecter la qualité de vie et nuire au fonctionnement d’une personne. L’outil de dépistage de la détresse utilise le thermomètre de la détresse (adapté et reproduit du NCCN “Distress Management Clinical Practices Guidelines in Oncology,” 2007) et la liste canadienne des problèmes pour évaluer la sévérité de la détresse chez les patient(e)s.&lt;br/&gt;&lt;br/&gt;Votre équipe de soins aimerait que vous remplissiez ce questionnaire. Vos réponses seront révisées par votre équipe et utilisées pour orienter votre rendez-vous.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-03-29 17:08:08', 'MAYU6004', '2021-03-29 21:08:08', 'MAYU6004');
INSERT INTO `dictionary` VALUES (20446, 27, 2, 9573, '&lt;p&gt;Distress is a feeling of discomfort or upset that can affect your quality of life and disturb your daily functioning. The Distress Screening Tool uses the Distress Thermometer (adapted and reproduced from the NCCN’s “Distress Management Clinical Practices Guidelines in Oncology,” 2007) and the Canadian Problem Checklist to evaluate the severity of distress in patients.&lt;br/&gt;&lt;br/&gt;Your healthcare team has requested that you please complete this questionnaire. The answers you provide will be viewed by your team and used to help focus your appointment.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-03-29 17:08:08', 'MAYU6004', '2021-03-29 21:08:08', 'MAYU6004');
INSERT INTO `dictionary` VALUES (20451, 27, 1, 9575, '', 0, NULL, '2021-03-29 17:08:08', 'MAYU6004', '2021-03-29 21:08:08', 'MAYU6004');
