INSERT INTO `dictionary` VALUES (22575, 27, 1, 10283, '&lt;p&gt;Les patients rapportent parfois qu\'ils ont les symptômes ou problèmes suivants lorsqu\'ils reçoivent une radiothérapie pour leur cancer de la prostate. Le suivi de ces symptômes peut aider votre radio-oncologue à intervenir rapidement et vous aider à mieux gérer les effets secondaires que vous pourriez ressentir. &lt;br/&gt;&lt;br/&gt;Veuillez indiquer la mesure dans laquelle vous avez vécu ces symptômes ou problèmes au cours de la semaine dernière.&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-05-27 08:52:30', 'PAHA6003', '2021-05-27 12:52:30', 'PAHA6003');
INSERT INTO `dictionary` VALUES (22576, 27, 2, 10283, '&lt;p&gt;Patients sometimes report that they have the following symptoms or problems when receiving radiation therapy for their prostate cancer. Tracking these symptoms can help your radiation oncologist intervene early and help you better manage any side effects you may experience.&lt;br/&gt;&lt;br/&gt;Please indicate the extent to which you have experienced these symptoms or problems during the past week.&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-05-27 08:52:30', 'PAHA6003', '2021-05-27 12:52:30', 'PAHA6003');
INSERT INTO `dictionary` VALUES (22581, 27, 1, 10285, '', 0, NULL, '2021-05-27 08:52:30', 'PAHA6003', '2021-05-27 12:52:30', 'PAHA6003');
