INSERT INTO `dictionary` VALUES (22593, 27, 1, 10289, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Veuillez lire attentivement chaque question et choisir la réponse qui décrit le mieux votre réponse&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Veuillez répondre à chaque question aussi honnêtement que possible&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Si vous n’êtes pas tout à fait sûr de la réponse la plus précise, sélectionnez la réponse qui vous semble la plus appropriée&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Veuillez sélectionner &amp;#34;aucune difficulté&amp;#34; si une question ne s’applique pas à vous&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Ne passez pas trop de temps sur chaque énoncé.&lt;/span&gt;&lt;!--EndFragment--&gt;&lt;br/&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-06-01 10:39:17', 'FAMA6017', '2021-06-01 14:39:17', 'FAMA6017');
INSERT INTO `dictionary` VALUES (22594, 27, 2, 10289, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Please read each question carefully and select the response that best describes your answer&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Please answer each question as honestly as possible&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- If you are not completely sure which response is the most accurate, select the response that you feel is the most appropriate&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Please select ‘no difficulty’ if a question does not apply to you&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;- Do not spend long on each statement.&lt;/span&gt;&lt;!--EndFragment--&gt;&lt;br/&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-06-01 10:39:17', 'FAMA6017', '2021-06-01 14:39:17', 'FAMA6017');
